Description.Desc:
Press <IconMap:Icon_Normal> to activate:
Perform up to 4 consecutive attacks forward, dealing <color=#F0D12B>Physical DMG</color> for the first two hits and <color=#2EB6FF>Electric DMG</color> for the third and fourth hits;
When hit during the fourth attack, triggers an automatic dodge.

After a <color=#FFFFFF>[Basic Attack]</color> 4th hit, <color=#FFFFFF>[EX Special Attack]</color>, <color=#FFFFFF>[Dodge Counter]</color>, <color=#FFFFFF>[Quick Assist]</color>, <color=#FFFFFF>[Assist Follow-Up]</color>, can be activated by holding or pressing <IconMap:Icon_Normal>:
Summon Mech to perform a charged punch attack. If the attack hits an enemy displaying red or yellow flash, or if hit by an enemy attack during skill activation, triggers Perfect Block effect, granting immunity to that DMG and increasing Interrupt Level to match Heavy Defensive Assist, dealing massive <color=#2EB6FF>Electric DMG</color>;
When <color=#FFFFFF>[Steel Charge]</color> exceeds 120, gain one chance to quickly unleash Falling Flower - Heavy Strike, activate directly by holding <IconMap:Icon_Normal>. This effect disappears after using Falling Flower - Heavy Strike once;
Character is invulnerable while using this skill.

Press <IconMap:Icon_Evade> to activate:
A quick dash dodge;
Character is invulnerable while using this skill.

With enough Energy, press <IconMap:Icon_SpecialReady> to activate:
Enter Flight Mode for 4-directional movement, firing continuous barrages dealing massive <color=#2EB6FF>Electric DMG</color>;
Hold <IconMap:Icon_SpecialReady> to extend barrage duration while consuming Energy;
During flight, release <IconMap:Icon_SpecialReady> to trigger Raining Iron Petals - Away;
After consuming 60 Energy points in one flight, automatically triggers Falling Petals - Slaughter;
Character is invulnerable while using this skill.

When a <color=#FFFFFF>Chain Attack</color> is triggered, select the character to activate:
Summons a Mech for protection, then launches explosives and a barrage of missiles forward, dealing massive <color=#2EB6FF>Electric DMG</color>;
Character is invulnerable while using this skill.
